import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="nav">
      <div className="nav-container">
        {/* Logo */}
        <Link to="/" className="nav-logo" aria-label="Tesla Home">
          {/* SVG Tesla logo */}
          <svg width="100" height="24" viewBox="0 0 100 24" fill="none" xmlns="http://www.w3.org/2000/svg">
            <text x="0" y="18" fontFamily="monospace" fontWeight="bold" fontSize="22" letterSpacing="8" fill="#111">TESLA</text>
          </svg>
        </Link>

        {/* Centered Main Links */}
        <div className="nav-menu">
          <Link to="/models" className="nav-link">Vehicles</Link>
          <a href="#" className="nav-link">Energy</a>
          <a href="#" className="nav-link">Charging</a>
          <a href="#" className="nav-link">Discover</a>
        </div>

        {/* Right Side Icons */}
        <div className="flex items-center gap-8">
          {/* Language/Globe Icon */}
          <button className="bg-transparent border-none p-0 m-0" aria-label="Language">
            <svg width="28" height="28" fill="none" stroke="#111" strokeWidth="2" viewBox="0 0 24 24">
              <circle cx="12" cy="12" r="10"/>
              <path d="M2 12h20M12 2a15.3 15.3 0 010 20M12 2a15.3 15.3 0 000 20"/>
            </svg>
          </button>
          {/* User Icon */}
          <button className="bg-transparent border-none p-0 m-0" aria-label="Account">
            <svg width="28" height="28" fill="none" stroke="#111" strokeWidth="2" viewBox="0 0 24 24">
              <circle cx="12" cy="8" r="4"/>
              <path d="M4 20c0-4 8-4 8-4s8 0 8 4"/>
            </svg>
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
